import React, {Component } from 'react';
import { Nav, NavDropdown } from 'react-bootstrap';

class Header extends Component {

    render () {
        return (<header>
            
            <div>{this.props.header}</div>
            <h1>{this.props.title}</h1>
            <Nav justify variant="tabs" defaultActiveKey="/home">
  <Nav.Item>
    <Nav.Link href="/home">メニュー</Nav.Link>
  </Nav.Item>
  <Nav.Item>
    <Nav.Link eventKey="link-1">月別入力</Nav.Link>
  </Nav.Item>
  <Nav.Item>
    <Nav.Link eventKey="link-2">交通費</Nav.Link>
  </Nav.Item>
<NavDropdown title="交通費" id="nav-dropdown">
        <NavDropdown.Item eventKey="4.1">交通費社内</NavDropdown.Item>
        <NavDropdown.Item eventKey="4.2">交通費社内</NavDropdown.Item>
      </NavDropdown>
      </Nav>

        </header>);
    }
}

export default Header;
